(window.webpackJsonpsmartcharts=window.webpackJsonpsmartcharts||[]).push([[5],{309:function(a){a.exports=JSON.parse('{"[symbol] feed is delayed by [delay] minutes":"[symbol] feed tertunda selama [delay] menit","[symbol] market is now opened.":"[symbol] pasar telah dibuka.","[symbol] market is presently closed.":"[symbol] pasar saat ini ditutup.","A technical momentum indicator that compares a security\'s closing price to its price range over a given time period. The oscillator\'s sensitivity to market movements can be reduced by adjusting the time period or by taking a moving average of the result.":"Indikator momentum teknis yang membandingkan harga penutupan sekuritas dengan kisaran harga selama periode waktu tertentu. Kepekaan osilator terhadap pergerakan pasar dapat dikurangi dengan menyesuaikan jangka waktu atau dengan mengambil rata-rata pergerakan hasilnya.","Active":"Aktif","Add":"Tambah","Add new template":"Tambahkan template baru","Add new templates":"Tambahkan template baru","All drawings":"Semua gambar","already exists.":"sudah tersedia.","Area":"Area","Available only for \\\\\\"Area\\\\\\" chart type.":"Hanya tersedia untuk jenis chart \\\\\\"Area\\\\\\".","Available only for non-tick time intervals.":"Hanya tersedia untuk interval waktu non-tik.","Bill Williams introduced the Alligator indicator in 1995. The Alligator is as much a metaphor as it is an indicator. It consists of three lines, overlaid on a pricing chart, that represent the jaw, the teeth and the lips of the beast, and was created to help the trader confirm the presence of a trend and its direction. The Alligator indicator can also help traders designate impulse and corrective wave formations, but the tool works best when combined with a momentum indicator.":"Bill Williams memperkenalkan indikator Alligator pada tahun 1995. Alligator merupakan metafora dari indikator itu sendiri. Terdiri dari tiga garis, mewakili jaw (rahang), teeth (gigi) dan lips (bibir) dari binatang buas itu, indikator ini diciptakan untuk membantu trader dalam mengkonfirmasi adanya tren dan arah. Indikator Alligator juga dapat membantu trader untuk menentukan formasi gelombang impuls dan korektif, alat ini bekerja dengan maksimal jika dikombinasikan dengan indikator momentum.","Bollinger Bands can be used to measure the highness or lowness of the price relative to previous trades.":"Bollinger Bands dapat digunakan untuk mengukur tinggi atau rendahnya harga relatif terhadap trading sebelumnya.","Box Size":"Ukuran Kotak","Cancel":"Batal","Candle":"Candle","Channel [num]":"Channel [num]","Chart data is not available for this symbol.":"Data chart tidak tersedia untuk simbol ini.","Chart types":"Jenis chart","Charts":"Chart","Clear all":"Hapus semua","CLOSED":"TUTUP","Color":"Warna","Continuous":"Terus menerus","Continuous [num]":"Continuous [num]","CSV":"CSV","Dark":"Gelap","day":"hari","days":"hari","Developed by Larry Williams, Williams %R is a momentum indicator that is the inverse of the Fast Stochastic Oscillator. Also referred to as %R, Williams %R reflects the level of the close relative to the highest high for the look-back period.":"Dikembangkan oleh Larry Williams, Williams %R adalah indikator momentum yang merupakan kebalikan dari Fast Stochastic Oscillator. Juga disebut sebagai %R, Williams %R mencerminkan tingkat kerabat dekat dengan tinggi tertinggi untuk periode lihat-kembali.","Developed by Tushar Chande in 1995, Aroon is an indicator system that determines whether a stock is trending or not and how strong the trend is. There are two separate indicators: Aroon-Up and Aroon-Down. A 25-day Aroon-Up measures the number of days since a 25-day high. A 25-day Aroon-Down measures the number of days since a 25-day low.":"Dikembangkan oleh Tushar Chande pada tahun 1995, Aroon adalah sistem indikator yang menentukan apakah suatu saham sedang tren atau tidak dan seberapa kuat trennya. Ada dua indikator terpisah: Aroon-Up dan Aroon-Down. Aroon-Up 25 hari mengukur jumlah hari sejak 25 hari tinggi. Sebuah Aroon-Down 25 hari mengukur jumlah hari sejak 25 hari level terendah.","Display data for a specific date and time":"Tampilkan data untuk tanggal dan waktu tertentu","Display remaining time for each interval":"Tampilkan sisa waktu untuk setiap interval","Display the highest and lowest spot price":"Tampilkan harga spot tertinggi dan terendah","Done":"Selesai","Download":"Download","Drawing tools":"Alat Menggambar","Favorites":"Favorit","Fib Fan [num]":"Fib Fan [num]","Fractals are indicators on candlestick charts that identify reversal points in the market. Traders often use fractals to get an idea about the direction in which the price will develop. A fractal will form when a particular price pattern happens on a chart.":"Fraktal adalah indikator pada grafik candlestick yang mengidentifikasi titik balik pasar. Trader sering menggunakan fraktal untuk mendapatkan ide tentang arah di mana harga akan berkembang. Fraktal akan terbentuk bila pola harga tertentu terjadi pada grafik.","H":"H","Highest and lowest spot":"Spot tertinggi dan terendah","Historical data mode":"Mode data historis","Hollow":"Hollow","Horizontal [num]":"Horisontal [num]","hour":"jam","hours":"jam","Indicators":"Indikator","Interval duration":"Durasi interval","Kagi":"Kagi","L":"L","Language":"Bahasa","Last digits stats for latest 1000 ticks on":"Statistik digit terakhir pada 1000 tik terbaru","Light":"Terang","Line [num]":"Line [num]","Line Break":"Jeda Baris","MACD is a trading indicator used in technical analysis of stock prices. It is supposed to reveal changes in the strength, direction, momentum, and duration of a trend in a stock\'s price.":"MACD adalah indikator trading yang digunakan dalam analisis teknis harga saham. Hal ini seharusnya dapat mengungkap perubahan dalam kekuatan, arah, momentum, dan durasi suatu tren harga saham.","Markets":"Pasar","minute":"menit","minutes":"menit","Momentum":"","Moving averages":"","Network status":"Status jaringan","No results for":"Tidak ada hasil untuk","OHLC":"OHLC","Opens in:":"Dibuka dalam:","Others":"","Overwrite":"Menimpa","Platform settings":"Pengaturan platform","PNG":"PNG","Point & Figure":"Titik & Gambar","Price Lines":"Baris Harga","Range":"Rentang","Range Bars":"Rentang Bar","Ray [num]":"Ray [num]","Rectangle [num]":"Rectangle [num]","Renko":"Renko","Reset":"Reset","Result":"Hasil","Retrieving Chart Data...":"Mengambil Data Chart...","Retrieving Chart Engine...":"Mengambil Chart Engine...","Retrieving Market Symbols...":"Menampilkan Simbol Pasar...","Retrieving Trading Times...":"Menampilkan Waktu Trading...","Reversal":"Pembalikan","Reversal Percentage":"Persentase Pembalikan","Right click to delete":"Klik kanan untuk menghapus","Right click to manage":"Klik kanan untuk mengelola","Saved templates":"Template yang disimpan","Search...":"Cari...","Select language":"Pilih bahasa","Select theme":"Pilih tema","Settings":"Pengaturan","Size":"Ukuran","Streaming for [symbol] is not available due to license restrictions":"Streaming untuk [symbol] tidak tersedia berhubung batasan lisensi","Templates":"Template","The Average Directional Movement Index index (ADX) was developed in 1978 by J. Welles Wilder as an indicator of trend strength in a series of prices of a financial instrument ADX will range between 0 and 100. Generally, ADX readings below 20 indicate trend weakness, and readings above 40 indicate trend strength.":"Average Directional Movement Index Indeks (ADX) dikembangkan pada tahun 1978 oleh J. Welles Wilder sebagai Indikator tren kekuatan serangkaian harga pada instrumen keuangan ADX berkisar ANTARA 0 dan 100. Pada umumnya ADX berada dibawah 20 menunjukkan tren pelemahan, dan bacaan diatas 40 menunjukkan penguatan tren.","The Awesome Oscillator is an indicator used to measure market momentum. AO calculates the difference of a 34 Period and 5 Period Simple Moving Averages. The Simple Moving Averages that are used are not calculated using closing price but rather each bar\'s midpoints. AO is generally used to affirm trends or to anticipate possible reversals.":"Awesome Oscillator adalah indikator yang digunakan untuk mengukur momentum pasar. AO menghitung selisih dari 34 periode dan 5 Masa Simple Moving Averages. Simple Moving Averages yang digunakan tidak dihitung menggunakan harga penutupan melainkan titik-titik tengah masing-masing bar. AO umumnya digunakan untuk menegaskan tren atau untuk mengantisipasi kemungkinan pembalikan.","The Commodity Channel Index (CCI) is a versatile indicator that can be used to identify a new trend or warn of extreme conditions.":"Commodity Channel Index (CCI) adalah indikator serbaguna yang dapat digunakan untuk mengidentifikasi tren baru atau memperingatkan kondisi ekstrim.","The Detrended Price Oscillator (DPO) helps to identify price cycles without the influence of short- and long-term trends. The DPO compares a simple moving average to a historical pricenear the middle of a specified period. It also shows the peaks and drops over that particular period, making it easier to predict buy points.":"Detrended Price Oscillator (DPO) dapat digunakan untuk membantu mengidentifikasi perputaran harga tanpa terpengaruh oleh tren jangka pendek dan jangka panjang. Memperlihatkan nilai tertinggi dan terendah pada periode tertentu, membuat analisa pembelian lebih mudah.","The Donchian Channel is an indicator used in market trading developed by Richard Donchian. It is formed by taking the highest high and the lowest low of the last n periods. The area between the high and the low is the channel for the period chosen.":"Saluran Donchian adalah indikator yang digunakan dalam trading pasar yang dikembangkan oleh Richard Donchian. Hal ini terbentuk dengan mengambil titik tertinggi dan terendah dari periode n terakhir. Area antara tinggi dan rendah adalah saluran untuk periode yang dipilih.","The Gator Oscillator helps to detect trend changes in the market price. Based on the Alligator indicator, the Gator plots 2 histograms on either side of the zero line. The sleeping phase (absence of a trend) is when the bars on both sides are red. The awakening phase (formation of a trend) is when there are red and green bars on both sides. When there are green bars on both sides, it indicates the eating phase (trend strengthening). A solitary red bar appearing after the eating phase indicates the beginning of the sated phase (trend approaching its end).":"Gator Oscillator dapat mendeteksi perubahan tren pada harga pasar. Berdasarkan pada indikator Alligator, Gator mengumpulkan 2 histogram pada kedua sisi garis nol. Fase tidur (tidak adanya tren) ketika bar di kedua sisinya berwarna merah. Ketika bar hijau di kedua sisi, hal tersebut menunjukkan fase makan (penguatan tren). Sebuah bar merah soliter muncul setelah fase makan menunjukkan awal dari fase puas (tren mendekati akhir).","The Ichimoku Cloud, also known as Ichimoku Kinko Hyo, is a versatile indicator that defines support and resistance, identifies trend direction, gauges momentum and provides trading signals. Ichimoku Kinko Hyo translates into “one look equilibrium chart”.":"Ichimoku Cloud, juga dikenal sebagai Ichimoku Kinko Hyo, adalah indikator serbaguna yang mendefinisikan support dan resistance, mengidentifikasi arah tren, pengukur momentum dan menyediakan sinyal trading. Ichimoku Kinko Hyo diterjemahkan menjadi “one look equilibrium chart” yaitu chart keseimbangan hanya dengan sekali lirik. ","The Moving Average (MA) helps to identify the overall market trend by filtering out short-term price fluctuations. Using historical data, it calculates the average price over a specific period and plots a line on the chart. If the MA line moves upwards, it’s an indicator of an uptrend, a downtrend if it moves downwards. A buy signal occurs when the price moves above the MA line.":"Moving Average (MA) digunakan untuk membantu mengidentifikasi tren pasar secara keseluruhan dengan menyaring fluktuasi harga jangka pendek. Menggunakan data historis, menghitung harga rata-rata selama periode tertentu dan plot garis pada grafik. Jika garis MA bergerak ke atas, hal ini merupakan indikator tren naik, tren turun jika bergerak ke bawah. Sinyal beli terjadi ketika harga bergerak di atas garis MA.","The Moving Average Envelope (MAE) helps to identify strong price movement that indicates the start of a trend. The MAE creates a moving average line as well as 2 bands around it. In theory, when the market price touches the upper or lower bands, a trend reversal will occur, indicating a buy signal.":"Moving Average Envelope (MAE) membantu untuk mengidentifikasi pergerakan harga yang kuat yang menunjukkan awal dari sebuah tren. MAE menciptakan garis moving average serta 2 band di sekitarnya. Secara teori, ketika harga pasar menyentuh band atas atau bawah, pembalikan tren akan terjadi, menunjukkan sinyal beli (buy).","The parabolic SAR is calculated almost independently for each trend in the price. When the price is in an uptrend, the SAR emerges below the price and converges upwards towards it. Similarly, on a downtrend, the SAR emerges above the price and converges downwards. At each step within a trend, the SAR is calculated one period in advance.":"Parabola SAR dihitung hampir secara independen untuk setiap tren harga. Bila harganya dalam uptrend, SAR muncul di bawah harga dan menyatu ke arah atasnya. Demikian pula, pada tren turun, SAR muncul di atas harga dan menyatu ke bawah. Pada setiap langkah dalam tren, SAR dihitung satu periode sebelumnya.","The Price Rate-of-Change (ROC) indicator displays the difference between the current price and the price x-time periods ago. The difference can be displayed in either points or as a percentage.":"Indikator Harga Rate-of-Change (ROC) menampilkan perbedaan antara harga saat ini dan harga periode waktu-x yang lalu. Perbedaannya dapat ditampilkan baik dalam poin atau sebagai persentase.","The Rainbow Moving Average (RMA) displays several moving average lines simultaneously. When the lines intersect, it’s an indicator of price reversal and the angle of the lines are helpful to predict the trend strength. The steeper the curve, the stronger the trend. When the price crosses the moving average lines from below, it signals an upward trend. When the price crosses the moving average lines from above, it signals a downward trend. The RMA is easier to use compared to using several different moving average indicators at once.":"Rainbow Moving Average (RMA) menampilkan beberapa garis Moving Average secara bersamaan. Ketika garis berpotongan, hal tersebut merupakan indikator pembalikan harga dan sudut garis sangat membantu untuk memprediksi kekuatan tren. Semakin curam kurva, maka semakin kuat tren yang terjadi. Ketika harga melintasi garis Moving Average dari bawah, hal tersebut menandakan tren ke atas. Ketika harga melintasi garis Moving Average dari atas, hal tersebut menandakan tren menurun. RMA lebih mudah digunakan dibandingkan dengan menggunakan beberapa indikator Moving Average lainnya.","The Relative Strength Index (RSI) was published by J. Welles Wilder. The current price is normalized as a percentage between 0 and 100. The name of this oscillator is misleading because it does not compare the instrument relative to another instrument or set of instruments, but rather represents the current price relative to other recent pieces within the selected lookback window length.":"Relative Strength Index (RSI) diterbitkan oleh J. Welles Wilder. Harga saat ini dinormalisasi sebagai persentasi antara 0 dan 100. Nama osilator ini sedikit membingungkan karena tidak membandingkan instrument relatif kepada instrumen lain atau beberapa instrumen melainkan merupakan harga saat ini relatif terhadap potongan baru lainnya diantara panjang jangkauan yang dipilih.","The Stochastic Momentum Index (SMI) helps to identify overbought or oversold conditions in the market and to predict bearish or bullish trends. It calculates the distance between the current closing price and the median of the high/low range, and displays 2 lines on the chart: the first (known as %K) represents the price movement while the second (known as %D) is a moving average of the first line. If the closing price is higher than the median of the high/low range, the SMI returns a positive value. If the closing price is lower than the average price, a negative value is returned. Values above 40 indicate a bullish trend while values below -40 indicate a bearish trend.":"Stochastic Momentum Index (SMI) membantu untuk mengidentifikasi kondisi lebih beli atau lebih jual pasar dan untuk memprediksi tren bearish atau bullish. Indikator ini menghitung jarak antara harga penutupan saat ini dan median dari kisaran tinggi/rendah, dan menampilkan 2 baris pada chart, yang pertama (dikenal sebagai %K) menunjukkan pergerakan harga sementara yang kedua (dikenal sebagai %D) adalah rata-rata bergerak dari baris pertama. Jika harga penutupan lebih tinggi dari median kisaran tinggi/rendah, SMI akan menampilkan nilai positif. Jika harga penutupan lebih rendah dari harga rata-rata, maka nilai negatif yang ditampilkan. Nilai di atas 40 menunjukkan tren bullish sementara nilai di bawah -40 menunjukkan tren bearish.","Themes":"Tema","There are no favorites yet.":"Favorit belum tersedia.","tick":"tik","Tick interval only available for \\\\\\"Area\\\\\\" Chart type.":"Interval tik hanya tersedia untuk jenis Chart \\\\\\"Area\\\\\\".","Time interval":"Interval waktu","Trend":"","Trend [num]":"Trend [num]","Try checking your spelling or use a different term":"Coba periksa ejaan atau gunakan istilah yang berbeda","Underlying Assets":"Aset Dasar","Up to 2 active indicators allowed.":"","Up to 5 active indicators allowed.":"Dibenarkan hingga 5 indikator aktif.","Vertical [num]":"Vertikal [num]","Volatility":"","Would you like to overwrite it?":"Apakah Anda ingin menggantikannya?","You have no active drawings yet.":"Anda belum memiliki gambar aktif.","You have no active indicators yet.":"Anda belum memiliki indikator aktif.","You have no saved templates yet.":"Anda belum memiliki template yang disimpan.","Zig Zag helps to identify trend reversals and filters out relatively small price movements by determining the support and resistance levels of the market. It accepts a percentage of deviation as the input and displays a line if the price change is larger than the percentage of deviation. Zig Zag ignores any sideways movement and is useful to filter out “market noise”.":"Zig zag membantu untuk mengidentifikasi pembalikan tren dan menyaring pergerakan harga yang relatif kecil dengan menentukan tingkat support dan resistance pasar. Indikator ini menerima persentase penyimpangan sebagai masukan dan menampilkan garis jika perubahan harga lebih besar dari persentase deviasi. Zig zag mengabaikan setiap gerakan menyamping dan berguna untuk menyaring \\"kebisingan pasar\\".","Zoom in":"Perbesar","Zoom out":"Perkecil"}')}}]);
